import { useDispatch, useSelector } from "react-redux";
import styles from "./Enrol.module.css";
import { entrySliceOpen } from "../../../Store/Slices/entrySlice";


const Enrol = (props) => {

    const openModalWindow = useSelector(state =>  state.entySlice.entrySliceOpenState);

    const dispatch = useDispatch();

    return (
        <>
           <button className={styles.button} onClick={dispatch(entrySliceOpen())}>{props.text}</button>

            {openModalWindow}

        </>
    )
}

export default Enrol;
